const SocialMediaWidget = () => {
  const styles = {
    container: {
      display: "flex",
      gap: "10px",
    },
    icon: {
      width: "24px",
      height: "24px",
      cursor: "pointer",
    },
  };

  return (
    <div style={styles.container}>
      <img src="/icons/facebook.png" alt="Facebook" style={styles.icon} />
      <img src="/icons/twitter.png" alt="Twitter" style={styles.icon} />
    </div>
  );
};

export default SocialMediaWidget;
